  item: {
    '& a': {
      width: 41,
    }

  },
  pagination: {
    margin: 3,
    '& a': {
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      background: theme.colors.transparent,
      fontWeight: '600',
      borderRadius: '6px!important',
      padding: 0,
      height: 36,
      border: '1px solid',
      borderColor: theme.colors.grey,
      color: theme.colors.darkGrey,
      boxShadow: 'none!important'
    }
  },
  prevNext: {
    width: 104
  }
}));

export default CatalogList;
